--CREAR TABLA
CREATE TABLE EMPLEADO
(
    NUMRUT_EMP NUMBER(10),
    DVRUT_EMP NUMBER(1),
    APPATERNO_EMP VARCHAR2(15) NOT NULL,
    APMATERNO_EMP VARCHAR2(15) NOT NULL,
    NOMBRE_EMP VARCHAR2(50) NOT NULL,
    DIRECCION_EMP VARCHAR2(60) NOT NULL,
